/*
Square Component
*/
import React from 'react'

class Square extends React.Component{

    constructor(prop){
        super(prop);
        this.state = {
            value: null,
        };
    }

    render(val){
        return(
            <button className="square" onClick={() => {alert('Clicked');}} >
                P:{val}
            </button>
        )
    }
}

export default Square;
